import React, { useState, useContext, useEffect } from "react";

import { Router } from "react-router-dom";

import Routes from "./Routes";
import Header from "./components/shared/Header";

import "./App.css";

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Routes />
      </Router>
    </div>
  );
}

export default App;
